CREATE OR REPLACE PROCEDURE cleanup_expired_tokens()
LANGUAGE plpgsql
AS $$
BEGIN
  DELETE FROM tokens
  WHERE access_token_expiration < NOW() OR refresh_token_expiration < NOW();
END;
$$;

CREATE OR REPLACE PROCEDURE cleanup_dead_tokens()
LANGUAGE plpgsql
AS $$
BEGIN
  DELETE FROM tokens
  WHERE refresh_token_expiration < NOW();
END;
$$;

